// Unmark element as invalid (validation is passed)
decorate(
    'CommonElement',
    'unmarkAsInvalid',
    function() {
        if (this.$element.hasClass('validation-error')) {
            this.$element.trigger('valid');
        }

        this.$element
            .data('lastValidationError', null)
            .data('lastValidationKey', null)
            .removeClass('validation-error')
            .removeClass('server-validation-error')
            .each(function() {
                this.hideInlineError();
            });

        this.$element.parent().removeClass('has-error');
        if ('undefined' != typeof(this.element.errorTooltipAssigned) && this.element.errorTooltipAssigned) {
            this.$element.tooltip('dispose');
            this.element.errorTooltipAssigned = false;
        }
        if ('undefined' != typeof(this.element.oldTitle) && this.element.oldTitle) {
            this.$element.attr('title', this.element.oldTitle);
            this.element.oldTitle = null;
        }

        this.triggerVent('unmarkAsInvalid', this);
    }
);

// Open as wait box change
core.bind(
    'popup.open',
    function(e)
    {
        jQuery('.block-wait-box .block-wait').remove();
        jQuery('.block-wait-box').append(jQuery('<div data-dialog-class="block-wait-box"><div class="block-wait"><div><div class="holder"><div class="preloader"><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div></div></div></div></div>'));
    }
);


jQuery(document).on('click', function (e) {
    if (jQuery('.ui-dialog').is(':visible') && !jQuery('.ui-dialog').hasClass('variant-video-popup') && !jQuery('.ui-dialog').hasClass('simple-popup') && !jQuery(e.target).closest('.ui-dialog').length) {
        jQuery('button.ui-dialog-titlebar-close').trigger('click');
    }
    return;
});

var footerCollapced = false;

function footerCollapser() {
    if (window.innerWidth > 767 && !footerCollapced) {
        return;
    }

    if (window.innerWidth > 767 && footerCollapced) {
        jQuery('.footer-menu--title').each(function() {
            var $this = jQuery(this),
                btn = $this.children('span'),
                menu = $this.children('ul');

            btn.removeAttr('data-toggle data-target aria-expanded aria-controls');
            menu.removeClass('collapsed collapse')
                .removeAttr('id aria-labelledby data-parent');
        });
        footerCollapced = false;
    }

    if (window.innerWidth < 768) {
        jQuery('.footer-menu--title').each(function (i) {
            var n = i + 1,
                $this = jQuery(this),
                btn = $this.children('span'),
                menu = $this.children('ul');

            btn.attr({
                'data-toggle': 'collapse',
                'data-target': '#collapse-' + n,
                'aria-expanded': 'false',
                'aria-controls': 'collapse-' + n,
            });

            menu.addClass('collapsed collapse').attr({
                'id': 'collapse-' + n,
                'aria-labelledby': 'heading-' + n,
                'data-parent': '#secondary-menu',
            });
        });

        footerCollapced = true;
    }
}

function getScrollbarWidth() {
    return window.innerWidth - document.documentElement.clientWidth;
}

function elementBounds(el,ignore) {
    const rect = el.getBoundingClientRect();
    const elHeight = el.offsetHeight;
    const breakpoint = (typeof ignore !== 'undefined' && ignore) ? (window.innerWidth > 1280 ? 106 : 80) : '';

    const bounds = {
        top: parseInt(rect.top + document.body.scrollTop + breakpoint),
        left: rect.left + document.body.scrollLeft,
        bottom: parseInt(rect.top + document.body.scrollTop + elHeight + breakpoint),
    }

    return bounds;
}

// Use for parent sections
function isElementInViewport(el,percentage) {
    const viewportHeight = window.innerHeight;
    const scrollTop = window.scrollY;
    const elementOffsetTop = el.offsetTop;
    const elementHeight = el.offsetHeight;
    const breakpoint = window.innerWidth > 1280 ? 106 : 80;

    // Calculate percentage of the element that's been seen
    const distance = scrollTop + (viewportHeight - breakpoint) - elementOffsetTop;
    const _percentage = Math.round(
        distance / (((viewportHeight - breakpoint) + elementHeight) / 100)
    );

    var out = 100 - (_percentage * 2 - 100),
        percent = 0;

    if (Math.sign(out) > 0 && out <= 100) {
        percent = Math.max(0, out);
    } else if (Math.sign(out) > 0 && out > 100) {
        percent = 100 - (out - 100);
    } else if (Math.sign(out) < 0) {
        percent = Math.sign(100 - (Math.abs(out) - 100)) < 0
            || Math.abs(out) > 0
            ? 0 : 100 - (Math.abs(out) - 100);
    }

    if (typeof percentage !== 'undefined') {
        if (percent >= percentage) {
            return true;
        }
    } else {
        // Workaround for undefined animation percentage
        if (percent >= 30) {
            return true;
        }
    }
    return false;
}

function animateElements(percentage) {
    var elements = typeof customSlide !== 'undefined'
        ? document.querySelectorAll('.need-slided')
        : document.querySelectorAll('.need-animation');

    if (elements.length) {
        if (typeof percentage == 'undefined') {
            var percentage = 30;
        }
        Array.prototype.forEach.call(elements, function(el, i){
            if (percentage) {
                if (isElementInViewport(el,percentage)) {
                    if (el.classList.contains('need-animation')) {
                        el.classList.remove('need-animation');
                        el.classList.add('js-animated');
                    }
                }
            }
        });
    }
}

jQuery(document).on('click','.get-in-touch .form-error a', function(e) {
    e.preventDefault();
    if (jQuery('.left-sticky--item.account').length) {
        jQuery('.left-sticky--item.account > a').dropdown('toggle');
        return false;
    }
});

(function($) {
    $.fn.simpleDropdown = function () {

        this.each(function () {
            jQuery(this).off('click').on('click', function () {
                var $this = jQuery(this),
                    id = $this.attr('id'),
                    show = $this.data('show');

                if (show) {
                    jQuery('.simple-dropdown-menu[aria-labelledby="'+id+'"]').fadeOut(250);
                    $this.data('show',false)
                        .attr('data-show',false)
                        .closest('.simple-dropdown').removeClass('show');
                } else {
                    jQuery('.simple-dropdown-menu').fadeOut(250);
                    jQuery('.simple-dropdown-toggle').data('show',false)
                        .attr('data-show',false)
                        .closest('.simple-dropdown').removeClass('show');

                    jQuery('.simple-dropdown-menu[aria-labelledby="'+id+'"]').fadeIn(250);
                    $this.data('show',true)
                        .attr('data-show',false)
                        .closest('.simple-dropdown').addClass('show');
                }
            });

            jQuery(document).on('click', function (e) {
                if (!jQuery(e.target).closest('.simple-dropdown').length) {
                    jQuery('.simple-dropdown-menu').fadeOut(250);
                    jQuery('.simple-dropdown-toggle').data('show',false)
                        .attr('data-show',false)
                        .closest('.simple-dropdown').removeClass('show');
                }
            });
        });

        return this;
    }
}(jQuery));

/** back to up */
jQuery(document).ready(function() {

    var btn = $('#back_to_top');

    $(window).scroll(function() {
        if ($(window).scrollTop() > 300) {
            btn.show();
        } else {
            btn.hide();
        }
    });

    btn.on('click', function(e) {
        e.preventDefault();
        $('html, body').animate({scrollTop:0}, '300');
    });

    footerCollapser();

});

