core.bind('load', function() {

    console.log('init Roih=' + (typeof window.rhEasy));
    
    window.rhEasy = window.rhEasy || [];

    var roihData = core.getCommentedData($('body'), 'roiheData');
    var cur_target = roihData.target;
    
    console.log(roihData);
    
    var roih_common_data = {
        platform: 'X_CART',
        conversionId: roihData.conversionId,
        conversionLabel: roihData.conversionLabel,
        fbPixelId: roihData.fbPixelId,
        pageType: '', // product | cart | checkout
    };
    
    if (cur_target == 'product') {
        
        roih_common_data.pageType = 'product';
        window.rhEasy.push(roih_common_data);
        
        // Product page only or on product variant changed
        window.rhEasy.push({product: roihData.product});
    }
    
    if (cur_target == 'cart' || cur_target == 'checkout') {
        
        roih_common_data.pageType = 'cart';
        window.rhEasy.push(roih_common_data);
        
        // On 'Add to Cart' event or cart page? 
        // moved to productaddedtocart event
        // window.rhEasy.push({cart: roihData.cart});
    }
    
    if (cur_target == 'checkoutSuccess') {
        
        roih_common_data.pageType = 'checkout';
        window.rhEasy.push(roih_common_data);
        
        // Checkout page only
        window.rhEasy.push({order: roihData.order});
    }

});

core.bind('productaddedtocart', function(ev, ev_data) {
        
    window.rhEasy = window.rhEasy || [];
    
    // On 'Add to Cart' event
    console.log('on add to cart item=', ev_data.roihe_item);
    window.rhEasy.push({
        cart: {
            items: [ ev_data.roihe_item ]
        }
    });
});;
