document.addEventListener(
    "DOMContentLoaded", function() {
            const slidebar = document.querySelector( "#slidebar" );

            if (typeof slidebar !== 'undefined' && typeof slidebar !== null) {
                const menu = new MmenuLight(
                    slidebar
                );

                const navigator = menu.navigation();
                const drawer = menu.offcanvas();
                const body = document.querySelector('body');

                document.querySelector( '#main_menu' )
                    .addEventListener( 'click', function( event ) {
                        // Workaround: slidebar vs modal issue
                        if (jQuery('.ui-dialog.ui-widget').length) {
                            jQuery('.ui-dialog.ui-widget').remove();
                        }

                        event.preventDefault();

                        if (body.classList.contains('mm-ocd-opened')) {
                            drawer.close();
                        } else {
                            drawer.open();
                        }
                    });

                document.onkeydown = function(evnt) {
                    evnt = evnt || window.event;

                    if (evnt.keyCode == 27) {
                        if (body.classList.contains('mm-ocd-opened')) {
                            drawer.close();
                        }
                    }
                };

                document.onclick = function(evnt) {
                    if (
                        evnt.target.closest('nav') == null
                        && evnt.target.closest('#main_menu') == null
                        && body.classList.contains('mm-ocd-opened')
                    ) {
                        drawer.close();
                    }
                }
            }
    }
);;
