var idleTime = 0,
    idleTimerStop = false,
    idleInterval = null;

function vidTimerIncrement() {
    if (!idleTimerStop) {
        idleTime++;
        if (idleTime > 1) {
            jQuery('#kitchen-top-preloader').fadeOut('1000');
            idleTimerStop = false;
        }
    }
}

var scroller = new SweetScroll({ header: '#header-area'});

function skipScreen() {
    // Scroll to the next screen
    var skipButton = jQuery('.left-sticky--item .scroll-down-button'),
        screens = jQuery('.landing-page--item');

    skipButton.off('click').on('click',function () {
        jQuery.each(screens,function (i) {
            if (screens[i].classList.contains('kitchen-top')) {
                if (isElementInViewport(screens[i],30)) {
                    var _id = jQuery(screens[i]).next().attr('id');

                    if (typeof _id !== 'undefined') {
                        scroller.to('#'+_id);
                    } else {
                        scroller.to('+='+window.innerHeight);
                    }
                }
            }

            if (isElementInViewport(screens[i],60)) {
                var _id = jQuery(screens[i]).next().attr('id');

                if (typeof _id !== 'undefined') {
                    scroller.to('#'+_id);
                } else {
                    scroller.to('+='+window.innerHeight);
                }
            }
        })
    });
}

document.addEventListener('DOMContentLoaded', function() {
    if (jQuery('#top-video-vid').length) {
        var topVideo = videojs('top-video-vid', {
            controls: false,
            autoplay: true,
            muted: true,
            preload: 'auto',
            loop: true,
            fluid: true,
        });
    }

    skipScreen();

    var rellax = new Rellax('.rellax', {
        speed: 6,
        vertical: true
    });

    idleInterval = setInterval(vidTimerIncrement, 1000);

    var topKitchen = document.getElementById('kitchen-top'),
        topVideoEl = document.getElementById('kitchen-top-video'),
        topTextOuter = document.getElementById('kitchen-top-text-outer'),
        topText = document.getElementById('kitchen-top-text'),
        topContent = document.getElementById('kitchen-top-content'),
        bottomBreakpoint = document.querySelectorAll('#kitchen-top-text .scroll-bottom-breakpoint'),
        topBreakpoint = document.getElementById('breadcrumb'),
        scrollPos = jQuery(window).scrollTop();


    window.addEventListener('scroll',function (event) {
        let topBreakpointPos = topBreakpoint.getBoundingClientRect().top + document.body.scrollTop;

        if (scrollDir) {
            if (topBreakpointPos <= 20) {
                if (
                    !topKitchen.classList.contains('tablet-device')
                    && !jQuery('body').hasClass('safari-ipad')
                ) {
                    topKitchen.classList.add('scrolled');
                    topVideoEl.classList.add('blured');
                    if (jQuery('#top-video-vid').length) {
                        topVideo.pause();
                    }
                }
            }
        } else {
            if (topBreakpointPos >= 20) {
                if (
                    !topKitchen.classList.contains('tablet-device')
                    && !jQuery('body').hasClass('safari-ipad')
                ) {
                    topKitchen.classList.remove('scrolled');
                    topVideoEl.classList.remove('blured');
                    if (jQuery('#top-video-vid').length) {
                        topVideo.play();
                    }
                }
            }
        }
            
    },{passive:true});

    document.addEventListener('keydown',function (e) {
        if (
            e.key == 'ArrowDown'
            || e.key == 'ArrowUp'
        ) {
            let topBreakpointPos = topBreakpoint.getBoundingClientRect().top + document.body.scrollTop;

            if (e.key == 'ArrowDown') {
                if (topBreakpointPos <= 20) {
                    topKitchen.classList.add('scrolled');
                    topVideoEl.classList.add('blured');
                    if (jQuery('#top-video-vid').length) {
                        topVideo.pause();
                    }
                }
            }

            if (e.key == 'ArrowUp') {
                if (topBreakpointPos >= 20) {
                    topKitchen.classList.remove('scrolled');
                    topVideoEl.classList.remove('blured');
                    if (jQuery('#top-video-vid').length) {
                        topVideo.play();
                    }
                }
            }
        }
    });

    if (window.location.hash == '#kitchen-projects') {
        setTimeout(function() {

                scroller.to('#kitchen-projects');

        }, 5000);
    }

});;
