document.addEventListener('DOMContentLoaded', function(event) {
    if (navigator.appVersion.indexOf("Win")!=-1) {
        jQuery('body').addClass('win-os');
    }

    var isSafari = /^((?!chrome|android).)*safari/i.test(navigator.userAgent);

    if (isSafari) {
        jQuery('body').addClass('safari');
    }

    // Workaround for iPad Pro 2019, iOS 14
    if (
        (isSafari && ('ontouchstart' in window))
    ) {
        jQuery('body').addClass('safari-ipad');
    }
    if (
        ('ontouchstart' in window) && !document.body.classList.contains('responsive-mobile')
    ) {
        jQuery('body').addClass('responsive-tablet');
    }

    //scroller.to('#kitchen-top');

    var totalImages = 396;
    var images = [],
        slider_wrap = jQuery('#kitchen-slider'),
        root_url = core.getCommentedData(slider_wrap);

    for(var i = 1; i < totalImages; i++) {
        var filename = 'kitchen_c_';
        if(i < 10) filename += '00';
        else if(i < 100) filename += '0';
        filename += i + '.jpg';
        var img = new Image;
        img.src = root_url.root_url + 'skins/Moley/customer/videos/kitchen/screen/' + filename;
        images.push(img);
    }
    var canv = document.getElementById('robotic-kitchen');
    var context = canv.getContext('2d');


    var currentLocation = 0;

    var setImage = function (newLocation) {
        context.drawImage(images[newLocation], 0, 0, 1280, 720);
    }
    var wheelDistance = function(evt){
        if (!evt) evt = event;
        var w=evt.wheelDelta, d=evt.detail;
        if (d){
            if (w) return w/d/40*d>0?1:-1;
            else return -d/3;
        } else return w/120;
    };
    var wheelDirection = function(evt){
        if (!evt) evt = event;
        return (evt.detail<0) ? 1 : (evt.wheelDelta>0) ? 1 : -1;
    };

    var screenPos = null;

    var MouseWheelHandler = function (e) {
        // The following equation will return either a 1 for scroll down
        // or -1 for a scroll up
        if (isSafari) {
            slideBreakpoint();

            if (wrapper.classList.contains('active')) {
                e.preventDefault();
            }
        }

        var distance = wheelDistance(e);
        var direction = wheelDirection(e);

        // This code mostly keeps us from going too far in either direction
        currentLocation -= Math.round(distance*3);
        if(currentLocation < 0) currentLocation = 0;
        if(currentLocation >= images.length)
            currentLocation = images.length - 1;

        // See below for the details of this function
        //console.log("currentLocation", currentLocation, distance);

        screenPos = currentLocation;

        if (isSafari) {
            var breakpoints = elementBounds(wrapper),
                hAdjust = window.innerWidth > 1280 ? 106 : 80;
            if (!scrollDir && currentLocation == 0 && breakpoints.top <= (hAdjust + 32)) {
                wrapper.classList.remove('active');
            }

            if (scrollDir && currentLocation >= 394) { //&& breakpoints.bottom <= (hAdjust + 32)) {
                wrapper.classList.remove('active');
                /*kitchen.style.transform = 'translateX(-100%)';
                cookwareText.style.opacity = 1;
                cookwareText.style.transform = 'translate(0,-50%)';*/
            }
        }

        setImage(currentLocation);
    };

    var _distance = 0;

    var keypressHandler = function (e) {
        e.preventDefault();

        // Distance in px to scroll down when you press "down/up" keys
        let distance = 200,
            breakpoints = elementBounds(wrapper),
            hAdjust = window.innerWidth > 1280 ? 106 : 80;

        if (e.key == 'ArrowDown') {
            window.scrollBy({
                top: distance,
                left: 0,
                behavior: 'smooth'
            });
        }

        if (e.key == 'ArrowUp') {
            window.scrollBy({
                top: -distance,
                left: 0,
                behavior: 'smooth'
            });
        }

        if (breakpoints.top <= (hAdjust + 32)) {

            if (e.key == 'ArrowDown') {
                _distance += distance;
            }

            if (e.key == 'ArrowUp') {
                _distance -= distance;
            }

            currentLocation = (_distance / 20);
            if (currentLocation < 0) currentLocation = 0;
            if (currentLocation >= images.length)
                currentLocation = images.length - 1;

            //console.log(currentLocation);
            setImage(currentLocation);

        }
    }

    const wrapper = document.getElementById('kitchen-slider-inner'),
          inner = wrapper.querySelector('.kitchen-carousel--bg-image'),
          kitchen = document.getElementById('robotic-kitchen'),
          leftSticky = window.innerWidth > 1280 ? 144 : 110,
          skipButton = jQuery('.left-sticky--item .scroll-down-button'),
          monitor = document.getElementById('monitor-gui'),
          protectiveScreen = document.getElementById('protective-screen'),
          appliancesStorage = document.getElementById('appliances-storage'),
          refrigeratorsContainers = document.getElementById('refrigerators-containers'),
          roboticHands = document.getElementById('robotic-hands'),
          cookware = document.getElementById('cookware'),
          monitorText = monitor.querySelector('.text'),
          protectiveScreenText = protectiveScreen.querySelector('.text'),
          appliancesStorageText = appliancesStorage.querySelector('.text'),
          refrigeratorsContainersText = refrigeratorsContainers.querySelector('.text'),
          roboticHandsText = roboticHands.querySelector('.text'),
          cookwareText = cookware.querySelector('.text');

    var slideBreakpoint = function () {
        var breakpoints = elementBounds(wrapper),
            hAdjust = window.innerWidth > 1280 ? 106 : 80;

        if (breakpoints.top <= (hAdjust + 32)) {
            if (!isSafari) {
                wrapper.classList.add('active');
            }

            //inner.style = 'width:'+wrapper.offsetWidth+'px';

            skipButton.on('click', function () {
                if (isSafari) {
                    wrapper.classList.remove('active');
                }
                scroller.to('#kitchen-tabs');
                currentLocation = 396;
                setImage(currentLocation);
            });

            monitor.classList.add('active');

            if (currentLocation < 58) {
                kitchen.style='';
                monitorText.style = 'opacity:' + (1 - (currentLocation / (58 / 100)) / 100);
            } else {
                monitorText.style = 'opacity: 0';
            }

            if (currentLocation > 58 && currentLocation < 100) {
                kitchen.style = 'transform: translateX(-'+((currentLocation - 58) / (42 / 100))/2+'%)';
            }// else if (currentLocation > 100) {
                //if (kitchen.style.transform !== 'translateX(-50%)') {
                //    kitchen.style.transform = 'translateX(-50%)';
                //}
            //}

            if (currentLocation > 70 && currentLocation < 100) {
                protectiveScreenText.style = 'opacity: ' + (currentLocation - 70) / (30 / 100) / 100;
            } else if (currentLocation < 70) {
                protectiveScreenText.style = '';
            }

            if (currentLocation > 100 && currentLocation < 135) {
                protectiveScreenText.style.opacity = 1 - ((currentLocation - 100) / (35 / 100) / 100);
                kitchen.style.transform = 'translateX(-50%) scale('+ parseFloat(1 + ((currentLocation - 100) / (35 / 100) / 1000))+')';
            }

            if (currentLocation > 135) {
                protectiveScreenText.style = '';
                kitchen.style.transform = 'translateX(-50%) scale(1.1)';
            }

            if (currentLocation > 135 && currentLocation < 150) {
                const progress = ((currentLocation - 135) / (15 / 100) / 100);
                appliancesStorageText.style.opacity = progress;
                //appliancesStorage.querySelector('.div-h2').style.transform = 'translateY(0) scale('+progress+')';
            } else if (currentLocation < 135) {
                appliancesStorageText.style = '';
            }

            if (currentLocation > 175 && currentLocation < 195) {
                const progress = 1 - ((currentLocation - 175) / (20 / 100) / 100);
                appliancesStorageText.style.opacity = progress;
                //appliancesStorage.querySelector('.div-h2').style.transform = 'translateY(0) scale('+progress+')';
            }

            if (currentLocation > 195) {
                appliancesStorageText.style = '';
            }

            if (currentLocation > 195 && currentLocation < 225) {
                refrigeratorsContainersText.style.opacity = ((currentLocation - 195) / (30 / 100) / 100);
            } else if (currentLocation <= 195) {
                refrigeratorsContainersText.style.opacity = '';
            }

            if (currentLocation > 230 && currentLocation < 260) {
                refrigeratorsContainersText.style.opacity = 1 - ((currentLocation - 230) / (30 / 100) / 100);
            }

            if (currentLocation > 260) {
                refrigeratorsContainersText.style.opacity = '';
            }

            if (currentLocation > 265 && currentLocation < 295) {
                roboticHandsText.style.opacity = ((currentLocation - 265) / (30 / 100) / 100);
            } else if (currentLocation < 265) {
                roboticHandsText.style.opacity = '';
            }

            if (currentLocation > 300 && currentLocation < 330) {
                roboticHandsText.style.opacity = 1 - ((currentLocation - 300) / (30 / 100) / 100);
                kitchen.style.transform = 'translateX(-50%) scale('+ parseFloat(1 + (0.1 - ((currentLocation - 300) / (30 / 100) / 1000)))+')';
            }

            if (currentLocation > 330) {
                roboticHandsText.style.opacity = '';
            } else {
                cookwareText.style = '';
            }

            if (currentLocation >= 330 && currentLocation < 360) {
                kitchen.style.transform = 'translateX(-'+(50 + ((currentLocation - 330) / (30 / 100))/2)+'%)';
                cookwareText.style.opacity = ((currentLocation - 330) / (30 / 100) / 100);
                cookwareText.style.transform = 'translate(' + (50 - ((currentLocation - 330) / (60 / 100))) + '%,-50%)';
            }

            if (currentLocation >= 360) {
                kitchen.style.transform = 'translateX(-100%)';
                cookwareText.style.opacity = 1;
                cookwareText.style.transform = 'translate(0,-50%)';
            }

        } else {
            if (!isSafari) {
                skipScreen();
                wrapper.classList.remove('active');
                monitor.classList.remove('active');
                inner.style = '';
                setImage(1);
                monitorText.style = 'opacity: 0; transition: opacity .5s ease-in-out';
            }
        }

        if (!isSafari) {
            if (breakpoints.bottom <= (hAdjust + 32)) {
                skipScreen();
                wrapper.classList.remove('active');
                inner.style = '';
            }
        }

        var sliderEntry = Math.round((window.scrollY - hAdjust) / ((breakpoints.top + hAdjust) / 100));

        if (scrollDir && sliderEntry > 30) {
            wrapper.classList.add('js-animated');
        }
    };

    setImage(1);

    window.addEventListener("scroll", function (e) {
        var breakpoints = elementBounds(wrapper),
            hAdjust = window.innerWidth > 1280 ? 106 : 80;

        if (!isSafari) {
            slideBreakpoint();

            if (
                scrollDir
                && breakpoints.bottom <= window.innerHeight*1.8
                && currentLocation < 360
                && breakpoints.bottom > 0
            ) {
                jQuery('#kitchen-slider-inner').height(jQuery('#kitchen-slider-inner').height() + window.innerHeight);
            }

        } else {

            if (breakpoints.top <= (hAdjust + 32) && breakpoints.top > -50 && scrollDir) {
                wrapper.classList.add('active');
            } else {
                if (!scrollDir) {
                    skipScreen();
                    wrapper.classList.remove('active');
                    monitor.classList.remove('active');
                    inner.style = '';
                    setImage(1);
                    monitorText.style = 'opacity: 0; transition: opacity .5s ease-in-out';
                }
            }

            if (currentLocation > 360 && breakpoints.top <= (hAdjust + 32) && breakpoints.top > -200 && !scrollDir) {
                wrapper.classList.add('active');
            }

            if (breakpoints.bottom <= (hAdjust + 32)) {
                skipScreen();
                wrapper.classList.remove('active');
                inner.style = '';
            }
        }
    },{passive:true});

    if (navigator.userAgent.indexOf('Firefox') > -1) {
        // Firefox
        window.addEventListener("DOMMouseScroll", function(e) {
            if (wrapper.classList.contains('active')) {
                MouseWheelHandler(e);
            }
        }, {passive:true});
    } else {
        if ('onwheel' in document) {
            window.addEventListener("wheel", function (e) {
                if (wrapper.classList.contains('active')) {
                    MouseWheelHandler(e);
                }
            }, false);
        } else if ('onmousewheel' in document) {
            window.addEventListener("mousewheel", function (e) {
                if (wrapper.classList.contains('active')) {
                    MouseWheelHandler(e);
                }
            });
        }
    }

    document.addEventListener('keydown',function (e) {
        if (
            e.key == 'ArrowDown'
            || e.key == 'ArrowUp'
        ) {
            keypressHandler(e);
        }
    });

},false);;
