function kitchenTabber() {
    var tabsNav = document.querySelectorAll('.kitchen-tabs--btn');
    var tabsContent = document.querySelectorAll('.kitchen-tabs--content');

    if (tabsNav.length && tabsContent.length) {
        Array.prototype.forEach.call(tabsNav, function (el, i) {
            el.addEventListener('click', function() {
                if (!this.classList.contains('active')) {
                    this.classList.add('active');
                    var tabIdx = this.dataset.rel;
                    for (var k = 0; k < tabsNav.length; k++) {
                        if (k !== i) {
                            tabsNav[k].classList.remove('active');
                        }
                    }
                    for (var j = 0; j < tabsContent.length; j++) {
                        if (tabsContent[j].dataset.tab == tabIdx) {
                            tabsContent[j].classList.add('active');
                        } else {
                            tabsContent[j].classList.remove('active');
                        }
                    }
                }
            });
        });
    }
}

core.autoload(kitchenTabber);;
